import logo from './logo.svg';
import './App.css';
import { Navbar } from 'react-bootstrap';
// import '../components/NavCustom.js';

import Button from 'react-bootstrap';

function App() {
  return (

    <div className="App">
    <header className="App-header">

      <>
        <Button variant="primary">Hi there</Button>{' '}
      </>
      </header>
    </div>
  );
}

export default App;
